import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Link,
  BrowserRouter,
  Routes,
  Outlet,
} from "react-router-dom";
import React, { useEffect, useState } from "react";
import Header from "./Components/Header";
import Footer from "./Components/Footer";
import Sidebar from "./Components/Sidebar";
import Home from "./Components/Home";
import Buyers from "./Components/Buyers";
import Add_buyers from "./Components/Add_buyers";
import Sellers from "./Components/Sellers";
import Add_seller from "./Components/Add_seller";
import Product from "./Components/Product";
import Add_product from "./Components/Add_product";
import Login from "./Components/Login";
import Profile from "./Components/Profile";

const Layout = () => {
  return (
    <>
      <Header></Header>
      <Sidebar></Sidebar>
      <Outlet></Outlet>
    </>
  );
};

function App() {
  const [auth, setAuth] = useState(sessionStorage.getItem("user"));
  return (
    <>
      <BrowserRouter>
        {auth ? (
          <>
            <Layout />
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/Home" element={<Home />} />
              <Route path="/Buyers" element={<Buyers />} />
              <Route path="/Add_buyers" element={<Add_buyers />} />
              <Route path="/Add_buyers/:id" element={<Add_buyers />} />
              <Route path="/Sellers" element={<Sellers />} />
              <Route path="/Add_sellers" element={<Add_seller />} />
              <Route path="/Add_sellers/:id" element={<Add_seller />} />
              <Route path="/Product" element={<Product />} />
              <Route path="/Add_product" element={<Add_product />} />
              <Route path="/Add_product/:id" element={<Add_product />} />
              <Route path="/Profile" element={<Profile />} />
              {/* <Route path="/Profile" element={<Profile />} /> */}
            </Routes>
          </>
        ) : (
          <>
            <Routes>
              <Route path="/" element={<Login />} />
            </Routes>
          </>
        )}
      </BrowserRouter>
    </>
  );
}
export default App;
